function swap(c,a,d){var b=c[a];c[a]=c[d];c[d]=b}function randomIntInRange(a,b){return Math.round(a+(Math.random()*(b-a)))}function doQuickSort(e,b,d,a){if(d<a){var f=randomIntInRange(d,a);var h=d-1;swap(e,f,a);var k=e[a];for(var g=d;g<a;g++){if(b(e[g],k)<=0){h+=1;swap(e,h,g)}}swap(e,h+1,g);var c=h+1;doQuickSort(e,b,d,c-1);doQuickSort(e,b,c+1,a)}}exports.quickSort=function(b,a){doQuickSort(b,a,0,b.length-1)};